  assert(status==kTfLiteOk);
  status = tflite::ops::micro::pooling::MaxEval(&cifar_context, &cifar_nodes[1]); // Input 12 Output 13
  assert(status==kTfLiteOk);
  status = tflite::ops::micro::conv::Eval(&cifar_context, &cifar_nodes[2]); // Input 13,10,2 Output 14
