  status = tflite::ops::micro::conv::Eval(&cifar_context, &cifar_nodes[4]); // Input 15,11,3 Output 16
  assert(status==kTfLiteOk);
  status = tflite::ops::micro::reshape::Eval(&cifar_context, &cifar_nodes[5]); // Input 16,6 Output 17
